import React from 'react'; 
 
import { Text, View,Button } from 'react-native'; 
 
import { NavigationContainer } from '@react-navigation/native'; 
 
import { createStackNavigator } from '@react-navigation/stack'; 
 
import HomeScreens from './HomeScreens'; 
 
import AddPetscreen from './AddPet'; 
 
import DetailsScreen from './DetailsScreen'; 
 
 
 
const Stack = createStackNavigator(); 
 
 
''
const NavScreens = () => { 
 
  return ( 
 
    <NavigationContainer> 
 
    <Stack.Navigator>  
 
       
 
      <Stack.Screen  
 
      options={{ 
 
        title:'HOME', 
 
        headerStyle: { 
 
          backgroundColor: '#f4511e', 
 
        }, 
 
        headerTintColor: '#fff', 
 
        headerTitleStyle: { 
 
          fontSize:25, 
 
          fontFamily:'Calibri', 
 
          textAlign:"center" 
 
        }, 
 
      } 
 
      }name="Home" component={HomeScreens} /> 
 
      <Stack.Screen  
 
       options={{ 
 
        title: 'ADD EMPLOYEE', 
 
        headerStyle: { 
 
          backgroundColor: 'blue', 
 
        }, 
 
        headerTintColor: 'white', 
 
        headerTitleStyle: { 
 
          fontSize:25, 
 
          fontFamily:'Calibri' 
 
        }, 
 
      }} 
 
      name="AddPetscreen"  component={AddPetscreen} /> 
 
      <Stack.Screen 
 
       options={{ 
 
        title: 'DETAILS', 
 
        headerStyle: { 
 
          backgroundColor: 'green', 
 
        }, 
 
        headerTintColor: 'white', 
 
        headerTitleStyle: { 
 
          fontSize:25, 
 
          fontFamily:'Calibri' 
 
        }, 
 
      }} 
 name="DetailsScreen" component={DetailsScreen} /> 
 
    </Stack.Navigator> 
 
  </NavigationContainer> 
 
  ); 
 
} 
 
export default NavScreens;
